const Products = () => {
  return (
    <>
      <section className="section">
        <h2>products</h2>
        <div className="products">
          {Products.map((product) => {
            return <article key={product.id}>
              <h5>{product.name}</h5>
              <Link to={`/products/${product.id}`}>Info</Link>
            </article>;
          })}
        </div>
      </section>
    </>
  );
};

export default Products;
